datasources.datasource:
SELECT c.nombre_srevicio,b.cantidad_servicios,c.costo_hora,b.cantidad_servicios*c.costo_hora AS ext,a.numero FROM cotizacion AS a,servicios_cotizacion AS b,servicios_externos AS c
WHERE a.numero=b.numero_cotizacion 
AND b.id_servicios_servicios_externos=c.id_servicios AND a.numero=$P{numerop}
